import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../assets/css/style.css'; // Assuming your CSS file is named styles.css
import dnaImage from '../assets/img/DNA-Genetics.webp';

function Login() {
  const [isFlipped, setIsFlipped] = useState(false);

  const handleFlip = () => {
    setIsFlipped(!isFlipped);
  };

  return (
    <div className="container">
      <input type="checkbox" id="flip" checked={isFlipped} onChange={handleFlip} />
      <div className="cover">
        <div className={isFlipped ? 'front flipped' : 'front'}>  {/* Conditional class for flipping */}
          <img src={dnaImage} alt="" />
          
        </div>
        <div className={isFlipped ? 'back flipped' : 'back'}>  {/* Conditional class for flipping */}
          <img src="images/backImg.jpg" alt="" />
          
        </div>
      </div>
      <div className="forms">
        <div className="form-content">
          <div className="login-form">
            <div className="title">Login</div>
            <form action="#">
              <div className="input-boxes">
                <div className="input-box">
                  <i className="fas fa-envelope"></i>
                  <input type="text" placeholder="Enter your email" required />
                </div>
                <div className="input-box">
                  <i className="fas fa-lock"></i>
                  <input type="password" placeholder="Enter your password" required />
                </div>
                <div className="text"><a href="#">Forgot password?</a></div>
                <div className="button input-box">
                <Link to="/admin/dashboard" ><input type="submit" value="Submit" /></Link>
                </div>
                <div className="text sign-up-text">
                  Don't have an account?     {" "}   
                  <Link to="/register"  htmlFor="flip">
                  Signup now
                  </Link>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
